(39, 14, 'N', 'N', 0, 14, 'TEST UPDATE STATUS PANJANG\n\nLaju cahaya (kelajuan cahaya dalam ruang vakum; kecepatan cahaya), disimbolkan dengan c, adalah sebuah konstanta fisika universal yang penting dalam banyak bidang fisika. Nilai presisinya adalah 299.792.458 meter per detik (kira-kira 3,00108 m/s), karena panjang meter didefinisikan berdasarkan konstanta ini dan standar internasional waktu.[1] Kelajuan ini merupakan kelajuan maksimum yang dapat dilajui oleh segala bentuk energi, materi, dan informasi dalam alam semesta. Kelajuan ini merupakan kelajuan segala partikel tak bermassa dan medan fisika, termasuk radiasi elektromagnetik dalam vakum. Kelajuan ini pula menurut teori modern adalah kelajuan gravitasi (kelajuan dari gelombang gravitasi). Partikel-partikel maupun gelombang-gelombang ini bergerak pada kelajuan c tanpa tergantung pada sumber gerak maupun kerangka acuan inersial pengamat. Dalam teori relativitas, c saling berkaitan dengan ruang waktu. Konstanta ini muncul pula pada persamaan fisika kesetaraan massa-energi E = mc2.[2]\n\nKelajuan cahaya yang merambat melalui bahan-bahan transparan seperti gelas ataupun udara lebih lambat dari c. Rasio antara c dengan kelajuan v (kelajuan rambat cahaya dalam suatu materi) disebut sebagai indeks bias n material tersebut (n = c / v). Sebagai contohnya, indeks refraksi gelas umumnya berkisar sekitar 1,5, berarti bahwa cahaya dalam gelas bergerak pada kelajuan c / 1,5  200.000 km/s; indeks refraksi udara untuk cahaya tampak adalah sekitar 1,0003, sehingga kelajuan cahaya dalam udara adalah sekitar 299.700 km/s (sekitar 90 km/s lebih lambat daripada c).\n\nUntuk berbagai tujuan praktis, cahaya dan gelombang elektromagnetik lainnya akan tampak untuk menyebar secara seketika, tetapi untuk jarak jauh dan pengukuran yang sangat sensitif, kelajuan terbatasnya memiliki efek yang nyata. Dalam berkomunikasi dengan wahana antariksa yang jauh, dapat membutuhkan bermenit-menit sampai berjam-jam untuk pesan untuk mencapai dari Bumi ke pesawat ruang angkasa, atau sebaliknya. Cahaya dilihat dari bintang meninggalkan mereka bertahun-tahun yang lalu, yang memungkinkan studi tentang sejarah alam semesta dengan melihat objek yang jauh. Kelajuan terbatas cahaya juga membatasi kecepatan maksimum teoretis komputer, karena informasi harus dikirim dalam komputer dari chip ke chip. Kecepatan cahaya dapat digunakan dengan pengukuran waktu penerbangan untuk mengukur jarak besar dengan presisi tinggi.\n\nOle Rmer pertama menunjukkan pada 1676 bahwa cahaya berjalan pada kecepatan yang terbatas (bukannya seketika) dengan mempelajari gerakan yang tampak dari bulan Yupiter Io. Pada tahun 1865, James Clerk Maxwell mengusulkan bahwa cahaya adalah gelombang elektromagnetik, dan karena itu bergerak dengan kecepatan c yang muncul dalam teori elektromagnetismenya.[3] Pada tahun 1905, Albert Einstein mendalilkan bahwa laju cahaya sehubungan dengan kerangka inersia independen dari gerakan sumber cahaya,[4] dan menjelajahi konsekuensi postulat dengan menurunkan teori relativitas khusus dan menunjukkan bahwa parameter c memiliki relevansi di luar konteks cahaya dan elektromagnetisme.\n\nSetelah berabad-abad pengukuran semakin tepat, pada tahun 1975 kecepatan cahaya diketahui sebagai 299.792.458 m/s dengan ketidakpastian pengukuran 4 bagian per miliar. Pada tahun 1983, meter didefinisikan kembali dalam Sistem Satuan Internasional (SI) sebagai jarak yang ditempuh oleh cahaya dalam ruang hampa di 1/299.792.458 detik. Akibatnya, nilai numerik dari c dalam meter per detik sekarang tetap persis dengan definisi meter.', 0, '2017-03-23 03:06:10', '2017-03-23 03:06:10'),
