INSERT INTO `stories` (`id`, `desa`, `user_id`, `title`, `slug`, `content`, `status`, `views`, `created_at`, `updated_at`) VALUES
(55, '1308040004', 27, 'SARAN EFEKTIF UNTUK MANAJEMEN BUMDES WISATA', '55-saran-efektif-untuk-manajemen-bumdes-wisata', '<?xml encoding="utf-8" ?><?xml encoding="utf-8" ?><!--?xml encoding="utf-8" ?--><!--?xml encoding="utf-8" ?--><p style="border: 0px; font-family: Arial, Helvetica, sans-serif; margin-bottom: 0px; outline: 0px; padding: 0px; vertical-align: baseline; color: rgb(64, 64, 64); text-align: justify;"><span style="border: 0px; font-family: inherit; font-style: inherit; font-weight: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;">Bila kita berkunjung ke desa Cihurip Kecamatan Cihurip Kabupaten Garut, jaraknya cukup dekat hanya 56 KM tapi bisa ditempuh dalam waktu 3 jam. Maklum selepas pusat kecamatan Cikajang (25 KM dari Kota Garut) kita melewati perbukitan dengan banyak sekali kelokan. Orang bilang &ldquo;belum selesai belok kiri sudah harus belok kanan&rdquo;, sehingga kecepatan kendaraan normal hanya berkisar antara 25-30 Km per jam. Setelah mencapai KM 50 tepatnya di Ciparay, kita harus belok kiri mulai masuk ke kawasan pegunungan dengan tanjakan dan turunan curam, jarak yang ditempuh di jalan masuk Cihurip walaupun hanya 6 KM bisa memakan waktu 30 menit atau bahkan 1 jam jika jalan sedang rusak parah.</span></p><p style="border: 0px; font-family: Arial, Helvetica, sans-serif; margin-bottom: 0px; outline: 0px; padding: 0px; vertical-align: baseline; color: rgb(64, 64, 64); text-align: justify;"><img data-filename="12052341_1175658232458498_7503575561285789988_o.png" style="width: 640px;" src="http://localhost/sosmed/public/images/10_1b3cc62be2c24e0b030951e4aeb77f2c.png"><span style="border: 0px; font-family: inherit; font-style: inherit; font-weight: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;"><br></span></p><p style="border: 0px; font-family: Arial, Helvetica, sans-serif; margin-bottom: 0px; outline: 0px; padding: 0px; vertical-align: baseline; color: rgb(64, 64, 64); text-align: justify;">Cihurip merupakan desa induk, selain Desa Cihurip, ada juga desa Mekarwangi, Desa Jayamukti dan Desa Cisangkal yang merupakan pemekaran dari desa Cihurip Induk. Tidak berlebihan bila saya sebut landscape Kecamatan Cihurip itu sangat indah, perpaduan kontur perbukitan, sawah terasering, hutan hijau, tebing batu vertikal di sisi timur dan barat dan dihiasi oleh view tak terhalang sampai laut selatan (sekalipun jauh). Secara tofografi Cihurip berupa lembah yang bisa kita intip dari atas jalan raya di puncak gunung ( namanya Puncak Pikiran). Dari saya kecil namanya sudah &ldquo;puncak pikiran&rdquo; sekitar 4 KM sebelum kantor kecamatan, dan 3 KM dari SD kami. Di puncak pikiran itu dulu tahun 80-an kami biasa jalan-kaki &ndash;sebagai anak desa- dengan teman sekelas untuk sekedar nonton proses rehabilitas jalan batu menggunakan stoom untuk pemadatan jalan.</p><p style="border: 0px; font-family: Arial, Helvetica, sans-serif; margin-bottom: 0px; outline: 0px; padding: 0px; vertical-align: baseline; color: rgb(64, 64, 64);">Saya masuk SD Mulyasari (Sekarang SD Cihurip III) pada tahun 1979 sampai tahun 1985. Dulu sebagai orang desa sering merasa minder karena merupakan SD kampung, sebagian temannya tidak beralas kaki, dan biasanya pada awal sekolah di kelas I, banyak teman SD yang tidak punya baru ganti yang memadai. Baju merah putih beberapa teman saya segera penuh getah pohon pisang, kotor, dan bau. Mengapa bau karena kadang setelah sekolah main ke sungai nangkap ikan kecil (beunteur) dan dimasukin ke saku baju atau saku celana, sampai rumah lupa, walhasil ikan kecil busuk itu kebawa ke sekolah. Ada acara seru ketika awal awal masuk sekolah, beberapa murid yang terindikasi masih &ldquo;bau&rdquo; disuruh mandi dulu di pancuran sekolah. Sungguh saya masih ingat nama teman SD itu sekarang sudah berkeluarga mungkin sudah punya cucu.</p><p style="border: 0px; font-family: Arial, Helvetica, sans-serif; margin-bottom: 0px; outline: 0px; padding: 0px; vertical-align: baseline; color: rgb(64, 64, 64);"><img class="alignnone size-full wp-image-148" src="http://blog.klikdesa.com/wp-content/uploads/2017/08/IMG-20170819-WA0015.jpg" alt="IMG-20170819-WA0015" width="1280" height="720" srcset="http://blog.klikdesa.com/wp-content/uploads/2017/08/IMG-20170819-WA0015.jpg 1280w, http://blog.klikdesa.com/wp-content/uploads/2017/08/IMG-20170819-WA0015-300x169.jpg 300w, http://blog.klikdesa.com/wp-content/uploads/2017/08/IMG-20170819-WA0015-768x432.jpg 768w, http://blog.klikdesa.com/wp-content/uploads/2017/08/IMG-20170819-WA0015-1024x576.jpg 1024w, http://blog.klikdesa.com/wp-content/uploads/2017/08/IMG-20170819-WA0015-150x84.jpg 150w" sizes="(max-width: 1280px) 100vw, 1280px" style="height: auto; max-width: 100%;"><img class="alignnone size-full wp-image-149" src="http://blog.klikdesa.com/wp-content/uploads/2017/08/IMG-20170413-WA0034.jpg" alt="IMG-20170413-WA0034" width="800" height="450" srcset="http://blog.klikdesa.com/wp-content/uploads/2017/08/IMG-20170413-WA0034.jpg 800w, http://blog.klikdesa.com/wp-content/uploads/2017/08/IMG-20170413-WA0034-300x169.jpg 300w, http://blog.klikdesa.com/wp-content/uploads/2017/08/IMG-20170413-WA0034-768x432.jpg 768w, http://blog.klikdesa.com/wp-content/uploads/2017/08/IMG-20170413-WA0034-150x84.jpg 150w" sizes="(max-width: 800px) 100vw, 800px" style="height: auto; max-width: 100%;"></p><p style="border: 0px; font-family: Arial, Helvetica, sans-serif; margin-bottom: 0px; outline: 0px; padding: 0px; vertical-align: baseline; color: rgb(64, 64, 64); text-align: justify;">Saya sadari bahwa ternyata sekolah kami keren setelah lulus kuliah, bahkan keren banget. Keren karena telah memenuhi aspek dan variabel subtantif dari proses belajar dan proses pendidikan yang lebih sejati. Setidaknya beberapa hal keren yang ingin disampaikan, antara lain adalah sebagai berikut:<br>Sekolah Alam Semesta<br>Sekolah kami sekolah alam, tanpa pagar jadi luasnya seluas semesta. Dari kecil kami tidak dididik dengan batas &ndash;batas spasial, merdeka, bebas dan dapat mengekplorasi alam semesta secara menyenangkan. Di sela sekolah kita mengenali tanaman hutan, belajar surfive, sehat dan gesit karena halaman kami luas sekali. Tiap hari pemandangan kami adalah keindahan yang berujung di batas horizon pantai Garut Selatan.</p><p style="border: 0px; font-family: Arial, Helvetica, sans-serif; margin-bottom: 0px; outline: 0px; padding: 0px; vertical-align: baseline; color: rgb(64, 64, 64); text-align: justify;">Guru-guru kami luar biasa<br>Guru-guru kami bekerja dua kali lipat lebih keras dibanding guru-guru di Kota Besar. Di SD kami guru paling banyak 4 kadang 3 orang, itu menjadi umum terjadi di daerah Garut selatan. Bahkan sampai hari ini karena biasanya guru-guru yang ditugaskan segera mengajukan pindah ke Garut kota (dengan segala cara termasuk KKN, lobi dan suap). Guru kami tidak mempunyai metode pengajaran yang canggih, tidak terampil membuat silabus, tidak menggunakan alat bantu berupa proyektor, jarang menggunakan buku paket, tidak artikulatif dalam teori teori pendidikan, tapi mereka berlimpah rasa tanggung jawab, surplus rasa cinta, penuh semangat dan dedikasi. Guru keren sekali, apalagi?</p><p style="border: 0px; font-family: Arial, Helvetica, sans-serif; margin-bottom: 0px; outline: 0px; padding: 0px; vertical-align: baseline; color: rgb(64, 64, 64);">Sekolah Nyaris Tanpa Pekerjaan Rumah<br>Sekolah kami sangat menyenangkan diantaranya adalah nyaris tanpa PR, tersedia banyak waktu untuk bermain &ldquo;sorodok gaplok&rdquo; &ldquo;babarenan&rdquo; atau berburu ikan juga puyuh. Kemana-mana jalan kami membuat badan sangat sehat, juga gemar berolahraga walaupun bola kita buat dari buah jeruk bali, bukankah itu tujuan utama pendidikan untuk membuat manusia kreatif, cerdas, dan bisa mandiri mengatasi kesulitan?</p><p style="border: 0px; font-family: Arial, Helvetica, sans-serif; margin-bottom: 0px; outline: 0px; padding: 0px; vertical-align: baseline; color: rgb(64, 64, 64); text-align: justify;">Efesien dalam belajar<br>Tidak ada buku paket, tidak ada LKS, tidak ada buku tulis mahal, hanya buku warna ungu produksi BUMN kertas PT Leces dari Padalarang, tapi apakah sekolah kami dengan demikian bisa disebut tidak bermutu? Sama sekali tidak, karena sekolah &ndash;makin disadari- bukan sekedar soal memasukan pengetahuan (yang secara otoriter dipaksakan oleh para cendikiawan pendidikan), sekolah juga adalah soal keterampilan belajar, soal menanamkan nilai, soal memahami efesiensi. Sekolah kami penuh substansi bukan instumen belajar yang artifisial dan digerakan oleh motif-motif proyek sejak di kementerian pendidikannya. Proyek alat peraga, proyek studi kebijakan, proyek workshop, proyek sosisasi, proyek desiminasi, dan juga bahkan proyek cetak mencetak, proyek evaluasi yang secara halus terselip motivasi ekonomi dibanding kata-kata bijak dan akademis.</p><p style="border: 0px; font-family: Arial, Helvetica, sans-serif; margin-bottom: 0px; outline: 0px; padding: 0px; vertical-align: baseline; color: rgb(64, 64, 64); text-align: justify;">Berkarakter<br>Saya bukan ahli pendidikan, tepai semakin memahami substansi pendidikan, saya semakin senang dengan sekolah kami dulu, sebelum banyak profesor menggaungkan pendidikan berkarakter, kami sudah melaluinya dengan hepi. Karakter menghormati guru, orang tua, karakter mandiri, karakter kerja keras, disiplin, kepemimpinan, empati, inisiatif, tanggung jawab melekat secara terintegrasi dengan kehidupan kami. Kita berjalan kaki lebih jauh, diberi kewajiban mengasuh adik, berkomunikasi sosial secara penuh, sejak SD.</p><p style="border: 0px; font-family: Arial, Helvetica, sans-serif; margin-bottom: 0px; outline: 0px; padding: 0px; vertical-align: baseline; color: rgb(64, 64, 64); text-align: justify;">Pintar-pintar<br>Jaman saya SD saya tidak pernah berhasil dapat ranking satu, walaupun ibu saya guru di sekolah itu dan Bapak saya salah satu tokoh lokal yang disegani. Seorang teman sangat cerdas dan mungkin mendekati jenius. Setelah SLTA di Garut, dua murid satu kelas di SD kami menjadi juara umum di masing-masing sekolah negeri di Garut pada waktu itu. Cerdas itu bawaan, sekolah seharusnya mengajari cara belajar bukan penuh dengan administrasi dan tumpukan pengetahuan yang secara menyakitkan akan menjadi &ldquo;sampah&rsquo; dalam kehidupan. Sekolah kami membuktikannya, tanpa banyak instrumen akhirnya bisa berkompetisi dengan SDM dari SD lain. Tidak pernah kalah oleh anak anak yang lahir dan besar di pusat kota Garut, pusat kota Bandung, atau bahkan Jakarta.<br>Saya kebetulan berkesempatan berinteraksi dengan banyak kawan dari seluruh Indonesia. Mengunjungi juga banyak pulau secara mendalam, dari Sumatera, Kepri, Bangka Belitung, jawa, Bawean, Kalimantan, Sulawesi, Bali, Lombok, Sumbawa sampai Biak dan pulau Papua Besar. Dalam perenungan selama interaksi tersebut, sampai pada kesimpulan bahwa banyak hal telah &ldquo;tersesat&rdquo; dari jalan benar, termasuk pendidikan kita. Kita telah lama mengingkari kejujuran secara universal atas nama standar dan evaluasi melalui UN. Kita telah lama terlampau asyik dengan instrumen dan teori-teori pendidikan, dengan diam-diam mulai tercerabut dari substansi pendidikan yang sesungguhnya</p><p></p><p></p><p></p>\n', 0, 0, '2017-08-22 08:17:28', '2017-09-11 06:59:16'),
(56, '1308040004', 27, 'MENGAPA APLIKASI DESA GRATIS, BELUM TENTU DIPAKAI?', '56-mengapa-aplikasi-desa-gratis-belum-tentu-dipakai', '<?xml encoding="utf-8" ?><p style="border: 0px; font-family: Arial, Helvetica, sans-serif; font-size: 16px; margin-bottom: 0px; outline: 0px; padding: 0px; vertical-align: baseline; color: rgb(64, 64, 64); text-align: justify;">Kita sudah selayaknya berterima kasih kepada google, kepada facebook, kepada twitter, yahoo, tokopedia, olx, kaskus dan banyak pengembangan software &Acirc;&nbsp;yang telah melayani kebutuhan kita sebelum kita minta.&Acirc;&nbsp; Google dan facebook juga yang lainnya &Acirc;&nbsp;tidak pernah datang kepada kita melakukan riset kebutuhan sistem informasi, tiba-tiba hadir di zagat online, memberi banyak solusi.&Acirc;&nbsp; Teknologi informasi membawa perubahan dramatis dalam cara kita bertegur sapa, membeli barang, membelanjakan uang, dan mencari pengetahuan, dan bahkan mencari jodoh.</p><p style="border: 0px; font-family: Arial, Helvetica, sans-serif; font-size: 16px; margin-bottom: 0px; outline: 0px; padding: 0px; vertical-align: baseline; color: rgb(64, 64, 64); text-align: justify;">Dari sisi jaringan selular juga saat ini sudah sangat keren. Sebagai contoh, di Pulau Jawa, agak susah mencari permukiman yang lost sinyal hanphone.&Acirc;&nbsp; Blank spot hanya kita temui di jalan yang jauh dari permukiman seperti sebagian kecil jalan dari Garut ke Arah Pameungpeuk, dari Panjalu Ciamis ke arah Cikijing Majalengka tepatnya di tanjakan Jahim, di sebelah atas Apuy lereng Ciremai di Majalengka. &Acirc;&nbsp;Pengalaman saya melakuan perjalanan darat dari Garut ke Surabaya mau lewat utara maupun selatan bahkan menggunakan jasa kereta api rasanya bebas blank spot. &Acirc;&nbsp;Demikian halnya pengalamans saya yang lain dari Garut sampai ke merak juga bebas blank spot. Warga desa di Pulau jawa sudah terkoneksi dengan internet dan artinya sudah banyak sekali yang akrab dengan media sosial, e commerce, dan aplikasi lainnya.</p><p style="border: 0px; font-family: Arial, Helvetica, sans-serif; font-size: 16px; margin-bottom: 0px; outline: 0px; padding: 0px; vertical-align: baseline; color: rgb(64, 64, 64); text-align: justify;">Kembali ke&Acirc;&nbsp; judul tentang aplikasi desa gratis, mungkin sepintas akan menjadi solusi implementasi desa berbasis teknologi informasi. Pengalaman membuktikan bahwa ternyata hambatan utamanya sesungguhnya bukan semata-mata harga aplikasi desa yang jadi penghambat.&Acirc;&nbsp; Tentang software desa gratis saya secara pribadi dan team pernah punya pengalaman berharga (di salah satu kabupaten di Jawa Barat) terlibat dalam sosialisasi dan implementasi aplikasi desa gratis.</p><div id="attachment_127" class="wp-caption alignnone" style="border: 1px solid rgb(204, 204, 204); font-family: Arial, Helvetica, sans-serif; font-size: 16px; margin: 0px 0px 0.5em; outline: 0px; padding: 0px; vertical-align: baseline; max-width: 100%; color: rgb(64, 64, 64); width: 1376px;"><p class="wp-caption-text" style="border: 0px; font-family: inherit; font-style: inherit; font-weight: inherit; margin-top: 0.5075em; margin-bottom: 0.5075em; outline: 0px; padding: 0px; vertical-align: baseline; text-align: center;">Ilustrasi User Interface</p></div><ol style="border: 0px; font-family: Arial, Helvetica, sans-serif; font-size: 16px; margin-right: 0px; margin-bottom: 0.5em; margin-left: 1em; outline: 0px; padding: 0px; vertical-align: baseline; list-style-position: initial; list-style-image: initial; color: rgb(64, 64, 64); text-align: justify;"><li style="border: 0px; font-family: inherit; font-style: inherit; font-weight: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;"><strong style="border: 0px; font-family: inherit; font-style: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;">Sowan ke pejabat setempat</strong></li></ol><p style="border: 0px; font-family: Arial, Helvetica, sans-serif; font-size: 16px; margin-bottom: 0px; outline: 0px; padding: 0px; vertical-align: baseline; color: rgb(64, 64, 64); text-align: justify;">Sowan dilakukan karena menjadi hal wajib, karena saat ini jika tidak sowan ke pejabat setempat kita bisa diangap liar, apalagi era dimana desa sering &Atilde;&cent;&acirc;&sbquo;&not;&Aring;&ldquo;seksi dan menark&Atilde;&cent;&acirc;&sbquo;&not;&Acirc;&#157; untuk didatangi setelah pencairan, oleh pihak &Atilde;&cent;&acirc;&sbquo;&not;&acirc;&euro;&oelig;pihak yang ingin &Atilde;&cent;&acirc;&sbquo;&not;&Aring;&ldquo;kebagian dana desa&Atilde;&cent;&acirc;&sbquo;&not;&Acirc;&#157;. Istilahnya setor muka, dan menyampaikan tujuan tujuan baik, di kecamatan biasanya hari senin saat kepala desa kumpul.</p><ol start="2" style="border: 0px; font-family: Arial, Helvetica, sans-serif; font-size: 16px; margin-right: 0px; margin-bottom: 0.5em; margin-left: 1em; outline: 0px; padding: 0px; vertical-align: baseline; list-style-position: initial; list-style-image: initial; color: rgb(64, 64, 64); text-align: justify;"><li style="border: 0px; font-family: inherit; font-style: inherit; font-weight: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;"><strong style="border: 0px; font-family: inherit; font-style: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;">Ekspose kebolehan sistem</strong></li></ol><p style="border: 0px; font-family: Arial, Helvetica, sans-serif; font-size: 16px; margin-bottom: 0px; outline: 0px; padding: 0px; vertical-align: baseline; color: rgb(64, 64, 64); text-align: justify;">Biasanya kita suka diberi kesempatan untuk ekspose sistem dihadapan para kepala desa atau pada sekdes.&Acirc;&nbsp; Disitulah kita menerangkan fitur-fitur software, kelebihan manfaat, kepraktisan dan otomatisasi sofware dalam melakukan perhitungan dan berbagai pengolahand data administrasi dan keuangan desa.&Acirc;&nbsp; Di tahap ini umumnya respon sangat cukup baik, mereka bilang &Atilde;&cent;&acirc;&sbquo;&not;&Aring;&ldquo;menarik&Atilde;&cent;&acirc;&sbquo;&not;&Acirc;&#157;. Eits jangan senang dulu, karena bisa saja hanya basa basi, sebuah penghiburan dan penghargaan&Atilde;&cent;&acirc;&sbquo;&not;&Acirc;&brvbar;.</p><ol start="3" style="border: 0px; font-family: Arial, Helvetica, sans-serif; font-size: 16px; margin-right: 0px; margin-bottom: 0.5em; margin-left: 1em; outline: 0px; padding: 0px; vertical-align: baseline; list-style-position: initial; list-style-image: initial; color: rgb(64, 64, 64); text-align: justify;"><li style="border: 0px; font-family: inherit; font-style: inherit; font-weight: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;"><strong style="border: 0px; font-family: inherit; font-style: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;">Ujicoba secara gratis</strong></li></ol><p style="border: 0px; font-family: Arial, Helvetica, sans-serif; font-size: 16px; margin-bottom: 0px; outline: 0px; padding: 0px; vertical-align: baseline; color: rgb(64, 64, 64); text-align: justify;">Ujicoba secara gratis di salah satu desa yang paling dekat dengan jalan raya menjadi salah satu jurus mengenalkan sofware.&Acirc;&nbsp; Sayangnya seringkali dihadapkan pada kendala teknis, misalnya petugasnya sedang tidak ada, komputernya rusak atau ada semacam ketakutan. Saya pernah gagal untuk instalasi di satu desa karena kepala desanya sedang keluar, dan tidak bisa dihubungi, yang ada staff desa. Dan mereka tidak mau diinstal sebelum ada ijin dari kepala desa, sekalipun sudah dijelaskan bahwa kami sudah ekspose di kecamatan, tetap tidak diperbolehkan.</p><ol start="4" style="border: 0px; font-family: Arial, Helvetica, sans-serif; font-size: 16px; margin-right: 0px; margin-bottom: 0.5em; margin-left: 1em; outline: 0px; padding: 0px; vertical-align: baseline; list-style-position: initial; list-style-image: initial; color: rgb(64, 64, 64); text-align: justify;"><li style="border: 0px; font-family: inherit; font-style: inherit; font-weight: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;"><strong style="border: 0px; font-family: inherit; font-style: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;">Bantuin Input data secara gratis</strong></li></ol><p style="border: 0px; font-family: Arial, Helvetica, sans-serif; font-size: 16px; margin-bottom: 0px; outline: 0px; padding: 0px; vertical-align: baseline; color: rgb(64, 64, 64); text-align: justify;">Salah satu bantuan gratis kami yang lain pada waktu itu adalah input data kependudukan ke dalam sistem.&Acirc;&nbsp; Ada ribuan orang yang harus dimasukan ke dalam sistem, beruntung ada data mentah dalam bentuk file excel yang bisa kita impor ke dalam sistem informasi surat menyurat dan kependudukan. &Acirc;&nbsp;Seharian kita bantuin untuk input dan praktek, juga secara gratis.</p><ol start="5" style="border: 0px; font-family: Arial, Helvetica, sans-serif; font-size: 16px; margin-right: 0px; margin-bottom: 0.5em; margin-left: 1em; outline: 0px; padding: 0px; vertical-align: baseline; list-style-position: initial; list-style-image: initial; color: rgb(64, 64, 64); text-align: justify;"><li style="border: 0px; font-family: inherit; font-style: inherit; font-weight: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;"><strong style="border: 0px; font-family: inherit; font-style: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;">Praktek implementasi secara gratis</strong></li></ol><p style="border: 0px; font-family: Arial, Helvetica, sans-serif; font-size: 16px; margin-bottom: 0px; outline: 0px; padding: 0px; vertical-align: baseline; color: rgb(64, 64, 64); text-align: justify;">Praktek implementasi gratis, ternyata juga tidak lantas membuat aplikasi dipakai oleh aparat desa. Aplikasi yang sudah kita instal, sudah kita isi datanya setelah satu bulan kita cek sama sekali tidak dipakai lagi. Kebiasaan manual sudah sangat kuat, sehingga teknologi sering kali dianggap malah ribet, teknik membuat surat dengan mencopy templete surat lama, mengganti nama dan alamat &Acirc;&nbsp;pemohon dan mengganti nomor surat secara manual ternyata jauh lebih disukai sekalipun menyulitkan dalam proses dokumentasi, dan evaluasi surat masuk dan keluar.</p><p style="border: 0px; font-family: Arial, Helvetica, sans-serif; font-size: 16px; margin-bottom: 0px; outline: 0px; padding: 0px; vertical-align: baseline; color: rgb(64, 64, 64); text-align: justify;">Pelajaran yang diperoleh dari pengalaman implementasi aplikasi desa di lapangan mengingatkan saya pada teori difusi inovasi pelajaran sosiologi perdesaan pada semester awal perkuliahan.&Acirc;&nbsp; Difusi inovasi bukan soal sederhana, ia adalah proses perubahan yang harus terus menerus disampaikan, diperjuangkan dari waktu ke waktu dengan sepenuh hati, kerja keras, dan penuh komitmen, sampai pada akhirnya perubahan yang dikehendari dapat dicapai, setelah berbulan-bulan atau bahkan bertahun-tahun!</p><p style="border: 0px; font-family: Arial, Helvetica, sans-serif; font-size: 16px; margin-bottom: 0px; outline: 0px; padding: 0px; vertical-align: baseline; color: rgb(64, 64, 64); text-align: justify;">( Aa Subandoyo / Klikdesa.com )</p><p></p>\n', 0, 0, '2017-08-22 08:18:04', '2017-09-26 08:04:45'),
(58, '1308040004', 27, '7 Text Editor Gratis Terbaik untuk Belajar Pemrograman Web', '58-7-text-editor-gratis-terbaik-untuk-belajar-pemrograman-web', '<?xml encoding="utf-8" ?><p><a href="http://tukangoding.blogspot.com/" target="_blank" style="border: 0px; font-variant-numeric: inherit; font-stretch: inherit; line-height: inherit; font-family: Roboto, sans-serif; font-size: 16px; margin: 0px; padding: 0px; vertical-align: baseline; color: rgb(244, 67, 54); outline: none; background-color: rgb(255, 255, 255);"><span style="border: 0px; font-style: inherit; font-variant: inherit; font-weight: 700; font-stretch: inherit; line-height: inherit; font-family: inherit; margin: 0px; padding: 0px; vertical-align: baseline;">TukaNgoding</span></a><span style="color: rgb(33, 33, 33); font-family: Roboto, sans-serif; font-size: 16px;">&Acirc;&nbsp;- Untuk memulai belajar pemrograman Web maka diperlukan sebuah Text Editor untuk tempat menulis kode programnya juga untuk membuat file-file webnya seperti file HTML, CSS, JavaScript, dll. Ada banyak sekali text editor yang bisa kita unduh di internet, ada yang gratis ada juga yang berbayar.</span><br style="color: rgb(33, 33, 33); font-family: Roboto, sans-serif; font-size: 16px;"><br style="color: rgb(33, 33, 33); font-family: Roboto, sans-serif; font-size: 16px;"><span style="color: rgb(33, 33, 33); font-family: Roboto, sans-serif; font-size: 16px;">Pada kesempatan kali ini TukaNgoding akan berbagi informasi mengenai</span><span style="border: 0px; font-variant-numeric: inherit; font-weight: 700; font-stretch: inherit; line-height: inherit; font-family: Roboto, sans-serif; font-size: 16px; margin: 0px; padding: 0px; vertical-align: baseline; color: rgb(33, 33, 33);">&Acirc;&nbsp;<a href="http://tukangoding.blogspot.co.id/2016/01/7-text-editor-gratis-terbaik-untuk-pemrograman.html" target="" style="border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: inherit; font-family: inherit; margin: 0px; padding: 0px; vertical-align: baseline; color: rgb(244, 67, 54); outline: none;">7 Text Editor Gratis Terbaik untuk Belajar Pemrograman Web</a></span><span style="color: rgb(33, 33, 33); font-family: Roboto, sans-serif; font-size: 16px;">, meskipun text editor ini gratis tetapi fitur-fiturnya tidak kalah dengan yang berbayar.</span><br style="color: rgb(33, 33, 33); font-family: Roboto, sans-serif; font-size: 16px;"><br style="color: rgb(33, 33, 33); font-family: Roboto, sans-serif; font-size: 16px;"></p><h3 style=''border: 0px; font-variant-numeric: inherit; font-weight: inherit; font-stretch: inherit; line-height: normal; font-family: "Product Sans", sans-serif; font-size: 1.3em; margin: 20px 0px 10px; padding: 0px; vertical-align: baseline; color: rgb(117, 117, 117);''>1. Notepad</h3><div class="separator" style="border: 0px; font-variant-numeric: inherit; font-stretch: inherit; line-height: inherit; font-family: Roboto, sans-serif; font-size: 16px; margin: 0px; padding: 0px; vertical-align: baseline; color: rgb(33, 33, 33); clear: both; text-align: center;"><a href="http://2.bp.blogspot.com/-XFl2WuOFAU4/VpcgL559FmI/AAAAAAAABtE/pfdoXlXrEZk/s1600/Notepad.png" imageanchor="1" style="border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: inherit; font-family: inherit; margin: 0px 1em; padding: 0px; vertical-align: baseline; color: rgb(244, 67, 54); outline: none;"><img alt="Notepad" border="0" height="324" src="http://2.bp.blogspot.com/-XFl2WuOFAU4/VpcgL559FmI/AAAAAAAABtE/pfdoXlXrEZk/s640/Notepad.png" title="Notepad" width="640" style="font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: inherit; font-family: inherit; margin: 0px; padding: 0px; vertical-align: baseline; outline: none; height: auto; max-width: 100%;"></a></div><div style="border: 0px; font-variant-numeric: inherit; font-stretch: inherit; line-height: inherit; font-family: Roboto, sans-serif; font-size: 16px; margin: 0px; padding: 0px; vertical-align: baseline; color: rgb(33, 33, 33); text-align: center;"><span style="border: 0px; font-style: inherit; font-variant: inherit; font-weight: bold; font-stretch: inherit; line-height: inherit; font-family: inherit; margin: 0px; padding: 0px; vertical-align: baseline;"><br></span></div><p><span style="border: 0px; font-variant-numeric: inherit; font-weight: 700; font-stretch: inherit; line-height: inherit; font-family: Roboto, sans-serif; font-size: 16px; margin: 0px; padding: 0px; vertical-align: baseline; color: rgb(33, 33, 33);">Platform</span><span style="color: rgb(33, 33, 33); font-family: Roboto, sans-serif; font-size: 16px;">&Acirc;&nbsp;: Windows</span><br style="color: rgb(33, 33, 33); font-family: Roboto, sans-serif; font-size: 16px;"><br style="color: rgb(33, 33, 33); font-family: Roboto, sans-serif; font-size: 16px;"><span style="color: rgb(33, 33, 33); font-family: Roboto, sans-serif; font-size: 16px;">Yup, bagi para pengguna OS windows pasti sudah tidak asing dengan text editor yang satu ini, meskipun tampilannya sangat simple tetapi notepad ini sangat cocok untuk memulai belajar membuat sebuah web khususnya untuk memulai belajar HTML.</span><br style="color: rgb(33, 33, 33); font-family: Roboto, sans-serif; font-size: 16px;"><br style="color: rgb(33, 33, 33); font-family: Roboto, sans-serif; font-size: 16px;"></p><h3 style=''border: 0px; font-variant-numeric: inherit; font-weight: inherit; font-stretch: inherit; line-height: normal; font-family: "Product Sans", sans-serif; font-size: 1.3em; margin: 20px 0px 10px; padding: 0px; vertical-align: baseline; color: rgb(117, 117, 117);''>2. Notepad++</h3><div class="separator" style="border: 0px; font-variant-numeric: inherit; font-stretch: inherit; line-height: inherit; font-family: Roboto, sans-serif; font-size: 16px; margin: 0px; padding: 0px; vertical-align: baseline; color: rgb(33, 33, 33); clear: both; text-align: center;"><a