html" rel="nofollow" target="_blank" style="border: 0px; font-variant-numeric: inherit; font-stretch: inherit; line-height: inherit; font-family: Roboto, sans-serif; font-size: 16px; margin: 0px; padding: 0px; vertical-align: baseline; color: rgb(244, 67, 54); outline: none; background-color: rgb(255, 255, 255);">Download Notepad++</a><span style="color: rgb(33, 33, 33); font-family: Roboto, sans-serif; font-size: 16px;">.</span><br style="color: rgb(33, 33, 33); font-family: Roboto, sans-serif; font-size: 16px;"><br style="color: rgb(33, 33, 33); font-family: Roboto, sans-serif; font-size: 16px;"></p><h3 style=''border: 0px; font-variant-numeric: inherit; font-weight: inherit; font-stretch: inherit; line-height: normal; font-family: "Product Sans", sans-serif; font-size: 1.3em; margin: 20px 0px 10px; padding: 0px; vertical-align: baseline; color: rgb(117, 117, 117);''>3. Komodo Edit</h3><div class="separator" style="border: 0px; font-variant-numeric: inherit; font-stretch: inherit; line-height: inherit; font-family: Roboto, sans-serif; font-size: 16px; margin: 0px; padding: 0px; vertical-align: baseline; color: rgb(33, 33, 33); clear: both; text-align: center;"><a href="http://3.bp.blogspot.com/-Joq5zN1upCk/VpcgNicUCjI/AAAAAAAABt4/pmAGDy9sRqI/s1600/komodo-edit.PNG" imageanchor="1" style="border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: inherit; font-family: inherit; margin: 0px 1em; padding: 0px; vertical-align: baseline; color: rgb(244, 67, 54); outline: none;"><img alt="Komodo Edit" border="0" height="372" src="http://3.bp.blogspot.com/-Joq5zN1upCk/VpcgNicUCjI/AAAAAAAABt4/pmAGDy9sRqI/s640/komodo-edit.PNG" title="Komodo Edit" width="640" style="font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: inherit; font-family: inherit; margin: 0px; padding: 0px; vertical-align: baseline; outline: none; height: auto; max-width: 100%;"></a></div><p><span style="border: 0px; font-variant-numeric: inherit; font-weight: 700; font-stretch: inherit; line-height: inherit; font-family: Roboto, sans-serif; font-size: 16px; margin: 0px; padding: 0px; vertical-align: baseline; color: rgb(33, 33, 33);">Platform</span><span style="color: rgb(33, 33, 33); font-family: Roboto, sans-serif; font-size: 16px;">: Windows/OS X/Linux</span><br style="color: rgb(33, 33, 33); font-family: Roboto, sans-serif; font-size: 16px;"><br style="color: rgb(33, 33, 33); font-family: Roboto, sans-serif; font-size: 16px;"><span style="color: rgb(33, 33, 33); font-family: Roboto, sans-serif; font-size: 16px;">Jika sobat membutuhkan sebuah text editor gratis yang mirip dengan sublime text saya rasa komodo edit adalah salah satunya, dengan fitur yang cukup banyak dan juga cukup ringan digunakan (saya sendiri menggunakannya) juga kita bisa memilih tema untuk tampilan editor ini.&Acirc;&nbsp;</span><a href="http://komodoide.com/komodo-edit/" rel="nofollow" target="_blank" style="border: 0px; font-variant-numeric: inherit; font-stretch: inherit; line-height: inherit; font-family: Roboto, sans-serif; font-size: 16px; margin: 0px; padding: 0px; vertical-align: baseline; color: rgb(244, 67, 54); outline: none; background-color: rgb(255, 255, 255);">Download Komodo Edit</a><span style="color: rgb(33, 33, 33); font-family: Roboto, sans-serif; font-size: 16px;">.</span><br style="color: rgb(33, 33, 33); font-family: Roboto, sans-serif; font-size: 16px;"><br style="color: rgb(33, 33, 33); font-family: Roboto, sans-serif; font-size: 16px;"></p><h3 style=''border: 0px; font-variant-numeric: inherit; font-weight: inherit; font-stretch: inherit; line-height: normal; font-family: "Product Sans", sans-serif; font-size: 1.3em; margin: 20px 0px 10px; padding: 0px; vertical-align: baseline; color: rgb(117, 117, 117);''>4. Atom</h3><div class="separator" style="border: 0px; font-variant-numeric: inherit; font-stretch: inherit; line-height: inherit; font-family: Roboto, sans-serif; font-size: 16px; margin: 0px; padding: 0px; vertical-align: baseline; color: rgb(33, 33, 33); clear: both; text-align: center;"><a href="http://4.bp.blogspot.com/-GU0MWLLx-yc/VpcgMfz1j6I/AAAAAAAABtw/1P46o6Q8zb8/s1600/atom.PNG" imageanchor="1" style="border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: inherit; font-family: inherit; margin: 0px 1em; padding: 0px; vertical-align: baseline; color: rgb(244, 67, 54); outline: none;"><img alt="Atom" border="0" height="306" src="http://4.bp.blogspot.com/-GU0MWLLx-yc/VpcgMfz1j6I/AAAAAAAABtw/1P46o6Q8zb8/s640/atom.PNG" title="Atom" width="640" style="font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: inherit; font-family: inherit; margin: 0px; padding: 0px; vertical-align: baseline; outline: none; height: auto; max-width: 100%;"></a></div><div style="border: 0px; font-variant-numeric: inherit; font-stretch: inherit; line-height: inherit; font-family: Roboto, sans-serif; font-size: 16px; margin: 0px; padding: 0px; vertical-align: baseline; color: rgb(33, 33, 33); text-align: center;"><br></div><p><span style="border: 0px; font-variant-numeric: inherit; font-weight: 700; font-stretch: inherit; line-height: inherit; font-family: Roboto, sans-serif; font-size: 16px; margin: 0px; padding: 0px; vertical-align: baseline; color: rgb(33, 33, 33);">Platform</span><span style="color: rgb(33, 33, 33); font-family: Roboto, sans-serif; font-size: 16px;">: OS X, Windows 7 &amp; 8, Linux</span><br style="color: rgb(33, 33, 33); font-family: Roboto, sans-serif; font-size: 16px;"><br style="color: rgb(33, 33, 33); font-family: Roboto, sans-serif; font-size: 16px;"><span style="color: rgb(33, 33, 33); font-family: Roboto, sans-serif; font-size: 16px;">Hampir mirip dengan Komodo Edit, Atom text editor memiliki banyak fitur hanya saja menurut saya penggunaanya cukup berat.&Acirc;&nbsp;</span><a href="https://atom.io/" rel="nofollow" 